import NavBar from "../components/layout/navBar";
import { useNavigate, Router } from "react-router-dom";
import classes from './Home.module.css';
import PostImage from '../assets/images/post.png';
import BackgroundPattern from '../assets/images/pearLogoPattern.svg';
import FadeIn from 'react-fade-in';
import CollaborateIcon from '../assets/icons/featureIcons/collaborateIcon.svg';
import LightbulbIcon from '../assets/icons/featureIcons/lightbulbIcon.svg';
import SearchIcon from '../assets/icons/featureIcons/searchIcon.svg';
import SendIcon from '../assets/icons/featureIcons/sendIcon.svg';
import MeImg from '../assets/images/me.jpg';

function Home() {

  const navigate = useNavigate();

  function headButton(){
    navigate('/register');
  }
  function toMyWebsite(){
    navigate("https://maxbraun.us");
  }
  return (
    <div>
      <NavBar />
      <div className={classes.header} style={{backgroundImage: `url(${BackgroundPattern})`}}>
        <div className={classes.headerLeft}>
          <div className={classes.headerLeftContainer}>
            <FadeIn>
              <h1 className={classes.headTitle}>Pear Programming</h1>
              <p className={classes.headDesc}>A place for developers to share ideas, find inspiration, and work together to build their skills and resumes.</p>
              <button onClick={headButton} className={classes.headButton}>Create an account</button>
            </FadeIn>
          </div>
        </div>
        <div className={classes.headerRight}>
          <FadeIn>
          <div className={classes.feature}>
            <img className={classes.featureIcon} src={LightbulbIcon}/>
            <div className={classes.featureInfo}>
              <h2 className={classes.featureTitle}>Post Ideas</h2>
              <p className={classes.featureDesc}>Post and describe your great ideas!</p>
            </div>
          </div>
          <div className={classes.feature}>
            <img className={classes.featureIcon} src={SearchIcon}/>
            <div className={classes.featureInfo}>
              <h2 className={classes.featureTitle}>Search Ideas</h2>
              <p className={classes.featureDesc}>Search by development category, popularity, or technology tags.</p>
            </div>
          </div>
          <div className={classes.feature}>
            <img className={classes.featureIcon} src={SendIcon}/>
            <div className={classes.featureInfo}>
              <h2 className={classes.featureTitle}>Send Requests</h2>
              <p className={classes.featureDesc}>Find an idea you like? Send a collaboration request to the post creator.</p>
            </div>
          </div>
          <div className={classes.feature}>
            <img className={classes.featureIcon} src={CollaborateIcon}/>
            <div className={classes.featureInfo}>
              <h2 className={classes.featureTitle}>Team Up</h2>
              <p className={classes.featureDesc}>Work together to create something great.</p>
            </div>
          </div>
          </FadeIn>
        </div>
      </div>
      <div className={classes.idea}>
        <img className={classes.meImg} src={MeImg}/>
        <h1 className={classes.ideaTitle}>Me and My Idea</h1>
        <p className={classes.ideaDesc}>My name is <a onClick={() => { window.location.href = 'https://maxbraun.us'}}>Max Braun</a>. I'm a senior in college majoring in Computer Science.</p>
        <p className={classes.ideaDesc}>As I began searching for jobs I could start after graduating, I learned a lot about resumes and how valuable having a solid set of personal projects on your resume can be when job searching. I also learned that many companies greatly value soft skills such as teamwork, communication, and collaboration when hiring developers. As great as my college education has been thusfar, I realized I haven't had a considerable amount of experience working with other developers, and I surely don't have a sizeable set of quality projects to show employers.</p>
      </div>
    </div>
  );
}

export default Home;
